import React, { Component } from 'react';
import './App.css';
import firebase from './firebase'
import StudentForm from './components/StudentForm';
import StudentList from './components/studentList';
import { Link } from 'react-router-dom'



class Crud extends Component {
  constructor(){
    super();


  }   

  handleAuth(){
    const provider =new firebase.auth.GoogleAuthProvider()
    firebase.auth().signInWithPopup(provider)
    .then(result => console.log(`${result.user.email} ha iniciado session`))
    .catch(error =>console.log(error))
  }


  render() {
    return (
    <div className="Crud">
      <div className="navbar navbar-ligth bg-primary">
        <Link className="text-white" to="/App">Tennis App</Link>
        <Link onClick={this.handleAuth} className="text-white mr-sm-2" to="/Home">Exit</Link>

      </div>
      <div className="container">
         <div className="col-md-6 m-5 ">
             <StudentForm/>


           </div>
           <div id="Students-list" className="col-md-12 mx-auto m-3">
           <StudentList/>
          </div> 

      </div>

    </div>
    );
  }
}

export default Crud;
